import uuid from 'uuid';

function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-10 mx-auto col-md-8 mt-4 ">
          <h1 className="text-capitalize text-center">Todo App</h1>
          <p>Organise your world!</p>
          <TodoInput/>
          <TodoList/>
        </div>
      </div>
  </div>

  );
}

export default App;
